import React from "react";

const NavItem = ({ nav_img, nav_num, setActive, setBtnNum, btn_name }) => {

    const changeState = () => {
        setActive(true);
        setBtnNum(nav_num);
    }

    return (
        <div onClick={changeState} id={"nav_item" + nav_num} className="nav_item">
            <div className="nav_item_img">
                <img className="btn_img" draggable="false" src={nav_img} alt="" />
            </div>
            <p> {btn_name} </p>
        </div>
    )
}

export default NavItem;
